import React, { useState } from "react";
import "./CustomerDashboard.css";

const CustomerDashboard = () => {
  const [complaintText, setComplaintText] = useState("");
  const [complaintId, setComplaintId] = useState("");
  const [complaintStatus, setComplaintStatus] = useState(null);

  const userData = {
    name: "Jane Doe",
    email: "jane@example.com",
    phone: "+9876543210",
  };

  const handleSubmitComplaint = (e) => {
    e.preventDefault();
    alert(`Complaint submitted: ${complaintText}`);
    setComplaintText("");
  };

  const handleTrackComplaint = (e) => {
    e.preventDefault();
    setComplaintStatus(`Complaint #${complaintId} is currently "In Progress"`);
  };

  return (
    <div className="cust-home-page">
      <div className="cust-home-container">
        <h1>Customer Dashboard</h1>

        <div className="cust-tabs-inline">
          {/* Submit Complaint */}
          <div className="cust-tab-box">
            <h3>Submit Complaint</h3>
            <form onSubmit={handleSubmitComplaint} className="cust-form">
              <textarea
                placeholder="Enter your complaint here..."
                value={complaintText}
                onChange={(e) => setComplaintText(e.target.value)}
                required
              />
              <button type="submit" className="cust-btn-submit">
                Submit
              </button>
            </form>
          </div>

          {/* Track Complaint */}
          <div className="cust-tab-box">
            <h3>Track Complaint</h3>
            <form onSubmit={handleTrackComplaint} className="cust-form">
              <input
                type="text"
                placeholder="Enter Complaint ID"
                value={complaintId}
                onChange={(e) => setComplaintId(e.target.value)}
                required
              />
              <button type="submit" className="cust-btn-submit">
                Track
              </button>
              {complaintStatus && <p className="cust-status">{complaintStatus}</p>}
            </form>
          </div>

          {/* User Profile */}
          <div className="cust-tab-box">
            <h3>User Profile</h3>
            <div className="cust-profile">
              <p><strong>Name:</strong> {userData.name}</p>
              <p><strong>Email:</strong> {userData.email}</p>
              <p><strong>Phone:</strong> {userData.phone}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CustomerDashboard;
